import React from "react";
import Shifter from "./Shifter";
import "./Items.css";

const Items = (props) => {
  if (props.data.length === 0) {
    return;
  }

  return (
    <div>
        <ul className="item">
          {props.data.map((shifter) => {
            return <Shifter time={shifter.time} employee={shifter.employee} />;
          })}
        </ul>
      <div className="item">
      </div>
    </div>
  );
};

export default Items;
